import re

def extract_unique_elements(input_list):
    number_set = set()
    word_set = set()
    for el in input_list:
        try:
            number = float(el)
            number_set.add(el)
        except ValueError:
            words = re.split('', el)
            for word in words:
                if re.search('\\d', word):
                    continue
                word = word.lower()
                if len(word) > 0:
                    word_set.add(word)
    return (list(number_set), list(word_set))

